import Login from './Login';
import Register from './Register';
import AddProduct from './AddProduct';
import UpdateProduct from './UpdateProduct';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Header />
     <h1>Eccomerce project</h1>
     <Route path="/login">
      <Login />
     </Route>
     <Route path="/register">
      <Register />
     </Route>
     <Route path="/add">
      <AddProduct />
     </Route>
     <Route path="/login">
      <Login />
     </Route>
     </BrowserRouter>
    </div>
  );
}

export default App;
